import React from 'react';
import picture from '../../images/climb3.jpeg'

import './AboutMe.css';

const AboutMe = ({id}) => {
    return(
            <div className = 'vh-100 center mt5' id = {id}>
                <div className = 'border-height'>
                    <h1 className = 'tc pt5 fw5'>About Me</h1>
                    <div className = 'bb w-50 center'>
                    </div>
                        <div className = 'mt3 mr3 ml3 b--dark-gray '>
                            <div className = 'vh-75 outer flex flex-wrap items-center '>
                                <div className = 'wrapper w-25 content'>
                                    <img src = {picture}
                                         className="br3 ba b--black-10 content pointer dim arrowRoot"
                                         alt = ''/>
                                    <p className = 'title' >hello</p>
                                </div>
                            </div>
                        </div>
                </div>
            </div>
 );
}

export default AboutMe;
